import { HttpClient } from '@angular/common/http';
import { Component, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
@Component({
  selector: 'app-flight-search',
  templateUrl: './flight-search.component.html',
  styleUrls: ['./flight-search.component.css']
})
export class FlightSearchComponent  implements OnInit{
  resultData: any;

  constructor(private route: ActivatedRoute) { }

  ngOnInit(): void {
    this.resultData = history.state.data;
    console.log('Result Data received:', this.resultData);
  }
}
<div>
  <h2>Flight Search Result</h2>

  <div *ngIf="resultData">
    <p><strong>Departure Date:</strong> {{ resultData.departureDate }}</p>
    <p><strong>Is Cheapest:</strong> {{ resultData.isCheapest }}</p>
    <p><strong>Offset Days:</strong> {{ resultData.offsetDays }}</p>

    <p><strong>Price:</strong></p>
    <ul *ngIf="resultData.price">
      <li><strong>Currency Code:</strong> {{ resultData.price.currencyCode }}</li>
      <li><strong>Units:</strong> {{ resultData.price.units }}</li>
      <li><strong>Nanos:</strong> {{ resultData.price.nanos }}</li>
    </ul>
  </div>

</div>
